var teamDetail = [649, '法国', '法國', 'France', 'images/164983446440.png', '巴黎', '巴黎', '', '法兰西大球场', '法蘭西大球場', 'Stade de France', '', '1919', '//www.fff.fr/', '<p><font face="Arial"><strong>球队简介：<br /></strong>　　截止2010年初，法国和阿根廷是仅有的两支赢得过国际足联最认可的三大赛事（世界杯、联合会杯、奥运会）冠军的队伍。法国国家男子足球队的球星&nbsp; 法国国家男子足球队的球星<br />随着齐达内时代在上届世界杯告一段落，新一代的法国球员崛起，里贝里、本泽马和古尔库夫等承载着法国队复兴的新希望。如今的法国队拥有新老结合的阵容，既有亨利、阿内尔卡、加拉斯等传承上一代衣钵的老将，也有古尔库夫、L-迪亚拉、萨尼亚等新一代球员。<br />　　从近几届大赛的势头看，法国队尚未真正走出齐达内等黄金一代告退的阴影。02年世界杯和04年欧洲杯该队成绩不佳，2010年世界杯是法国队表现最为糟糕的一届世界杯。06年世界杯靠着齐达内、维埃拉等老将的最后爆发打进了决赛，但当老队员先后离开后，法国随即在08年欧洲杯上遭遇惨败，甚至未能从小组出线。在2010南非世界杯预选赛上，法国队跌跌撞撞的进入决赛圈，但在小组赛过程中，内讧、开除球员、全队罢赛，不仅小组未能出线，还在全世界范围内造成了恶劣的影响。<br /><strong>球队荣誉：</strong><br />世界杯决赛週： <br />　　参赛次数 13 （1930年首次参赛） <br />　　最佳成绩 冠军，1998年 <br />欧洲足球锦标赛 <br />　　参赛次数 6（1960年首次参赛） <br />　　最佳成绩 冠军，1984年及2000年 <br />联合会杯 <br />　　参赛次数 2（2001年首次参赛） <br />　　最佳成绩 冠军，2001年及2003年<br /><strong>世界杯战史：<br /></strong>　　截至2010年，法国共13次参加世界杯决赛圈，最好成绩是1998年获得冠军，另外还在2006年得到亚军，在2010年南非世界杯上，小组未能出线。<br />世界杯创立之初，法国参加了头三届大赛，但均未取得理想成绩。直到1958年瑞典世界杯上，拥有传奇射手方丹的法国队一路打进4强，并最终获得了第三名，方丹还以单届13个进球创造了历史纪录，这也是法国第一次在世界杯历史上留下属于自己的辉煌印记。<br />　　进入80年代，随着普拉蒂尼等一批巨星的涌现，法国队进入了世界杯历史上的第二个高峰期，该队在1982和86年世界杯上连续打进4强，分别获得了第四和第三，值得一提的是，普拉蒂尼的那一代法国队一直牢牢的被死敌德国压在身下，两届大赛半决赛都被德国人淘汰出局。<br />在经历了连续两届无缘决赛圈（1990、1994）的阵痛后，新一批巨星的崛起，终于将法国推上了世界杯历史的最高峰。以齐达内为首的黄金一代，1998年在本土称雄，这也是该国第一次夺取世界杯冠军。2006年，步入职业生涯末期的齐达内一路带领法国冲入决赛，但他的红牌和队友在点球战中的失利，令法国未能再次染指冠军。<br />　　2010年6月12日，在南非世界杯A组第一轮，法国战平10人乌拉圭，连续3届首战不胜。6月18日，世界杯小组赛又战一场，A组实力最强的前世界杯冠军法国队爆冷0:2不敌墨西哥队；阿内尔卡在本场比赛比赛中场休息时&ldquo;辱骂&rdquo;教练多梅内克，法国国家足球协会决定开除阿内尔卡。开创了一名国家队球员在赛事期间被遣返回家的新纪录。翌日法国球队出现在训练场时，在全球镜头前爆发了法国队队长埃弗拉与体能教练杜韦尔尼激烈争吵的一幕，埃弗拉后来在新闻发布会上表示，&ldquo;球队里出了一个可耻的&lsquo;叛徒&rsquo;&rdquo;。更令人震惊的是，6月20日，法国队队员竟然全体罢训，内讧进一步升级。在小组末轮法国迎战南非之前，法国官方人员指名道姓点出球队中的几名&ldquo;内鬼&rdquo; 。后来，法国队的此次世界杯之行在2010年6月22日对南非1：2的失利中郁郁而终。</font></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2014年世界杯，小组赛阶段，法国2胜1平获得头名出线。十六强战，面对非洲雄鹰尼日利亚，法国踢得游刃有余，最终2-0轻取对手晋级。八强战，法国面对强劲对手德国。整场比赛，两队都踢得一场胶着，最终仅仅是凭借开场13分钟胡梅尔斯利用定位球头球破门，德国才小胜晋级，法国遗憾出局。 <br />　　2016年，法国作为东道主，迎来欧洲杯盛会。该届大赛，法国一路高歌猛进，半决赛更是2球完胜2年前世界杯淘汰自己的德国，完成复仇杀入决赛。决赛对阵葡萄牙，两队鏖战90分钟0-0不分胜负。加时赛中，葡萄牙把握住机会攻破法国大门，法国饮恨欧洲杯决赛。 <br />　　2018年将是法国第15次参加世界杯决赛阶段的比赛。</p>', '欧洲', '', 0];
